import React from "react";
import "../styles.css"; // Ensure this matches your setup
import { useNavigate } from "react-router-dom";

const Dashboard = () => {
  const navigate = useNavigate();

  const cards = [
    {
      icon: "üß†",
      title: "Neurological Rehab",
      description: "Balance & coordination\nCognitive movement\nMotor learning",
      route: "/exercise/neuro",
    },
    {
      icon: "ü¶µ",
      title: "Orthopedic Rehab",
      description: "Post-surgery mobility\nJoint strengthening\nPain reduction",
      route: "/exercise/ortho",
    },
    {
      icon: "‚ù§Ô∏è",
      title: "Cardiac Rehab",
      description: "Endurance training\nSafe cardio routines\nPulse monitoring",
      route: "/exercise/cardiac",
    },
    {
      icon: "üìà",
      title: "Track Progress",
      description: "Review past sessions\nVisual graphs\nCompare performance",
      route: "/progress",
    },
    {
      icon: "üó£Ô∏è",
      title: "Real-Time Feedback",
      description: "Live pose alerts\nVoice instructions\nImprove technique",
      route: "/feedback",
    },
  ];

  return (
    <div>
      <header className="dashboard-header">
        <h1 className="dashboard-title">AI Rehab Dashboard</h1>
        <button className="logout-button" onClick={() => navigate("/")}>
          Logout
        </button>
      </header>

      <div className="main-content">
        {cards.map((card, index) => (
          <div className="card" key={index}>
            <h2>{card.icon} {card.title}</h2>
            <p>
              {card.description.split("\n").map((line, i) => (
                <span key={i}>{line}<br /></span>
              ))}
            </p>
            <button className="start-button" onClick={() => navigate(card.route)}>
              Start
            </button>
          </div>
        ))}
      </div>
    </div>
  );
};

export default Dashboard;
